import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.function.Function;
import scala.Tuple2;

import java.util.HashMap;
import java.util.Map;

public class CacheHitRateJob {
    public static void main(String[] args) {
        // Assume you have the Spark context set up
        // JavaSparkContext sc = ...

        // Load the onsite attributed data
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");

        // Load the top frequent queries data
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Convert the top frequent queries to a set for faster lookup
        final Map<String, Long> cache = new HashMap<>();
        for (String query : topQueries.collect()) {
            cache.put(query, System.currentTimeMillis());
        }

        // Define the cache expiration time (12 hours in milliseconds)
        final long cacheExpirationTime = 12 * 60 * 60 * 1000;

        // Calculate the hit rate
        JavaRDD<Tuple2<String, Integer>> hitRateData = onsiteData.map(new Function<String, Tuple2<String, Integer>>() {
            @Override
            public Tuple2<String, Integer> call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                if (cache.containsKey(query)) {
                    long cachedTime = cache.get(query);
                    if (timestamp - cachedTime <= cacheExpirationTime) {
                        return new Tuple2<>(query, 1); // Cache hit
                    }
                }
                cache.put(query, timestamp); // Cache miss, add to cache
                return new Tuple2<>(query, 0); // Cache miss
            }
        });

        // Calculate the total hits and total requests
        Tuple2<Integer, Integer> hitRateResult = hitRateData.aggregate(new Tuple2<>(0, 0),
                new Function2<Tuple2<Integer, Integer>, Tuple2<String, Integer>, Tuple2<Integer, Integer>>() {
                    @Override
                    public Tuple2<Integer, Integer> call(Tuple2<Integer, Integer> acc, Tuple2<String, Integer> tuple) throws Exception {
                        return new Tuple2<>(acc._1 + tuple._2, acc._2 + 1);
                    }
                },
                new Function2<Tuple2<Integer, Integer>, Tuple2<Integer, Integer>, Tuple2<Integer, Integer>>() {
                    @Override
                    public Tuple2<Integer, Integer> call(Tuple2<Integer, Integer> acc1, Tuple2<Integer, Integer> acc2) throws Exception {
                        return new Tuple2<>(acc1._1 + acc2._1, acc1._2 + acc2._2);
                    }
                });

        int totalHits = hitRateResult._1;
        int totalRequests = hitRateResult._2;
        double hitRate = (double) totalHits / totalRequests;

        System.out.println("Total Hits: " + totalHits);
        System.out.println("Total Requests: " + totalRequests);
        System.out.println("Hit Rate: " + hitRate);
    }
}
```

